// RUCI: reg_read --------------------------------------------------------------
#define RUCI_REG_READ                           RUCI_NUM_REG_READ, ruci_elmt_type_reg_read, ruci_elmt_num_reg_read
#define RUCI_CODE_REG_READ                      0x07
#define RUCI_LEN_REG_READ                       8
#define RUCI_NUM_REG_READ                       4
#define RUCI_PARA_LEN_REG_READ                  4
#if (RUCI_ENDIAN_INVERSE)
extern const uint8_t ruci_elmt_type_reg_read[];
extern const uint8_t ruci_elmt_num_reg_read[];
#endif /* RUCI_ENDIAN_INVERSE */
typedef struct ruci_para_reg_read_s
{
    ruci_head_t     ruci_header;
    uint8_t         sub_header;
    uint16_t        length;
    uint32_t        addr;
} ruci_para_reg_read_t;

/* User should provide msg buffer is greater than sizeof(ruci_para_reg_read_t) */
#define SET_RUCI_PARA_REG_READ(msg, addr_in)        \
        do{                                                                                                            \
        ((ruci_para_reg_read_t *)msg)->ruci_header.u8                 = RUCI_SF_HOST_CMD_HEADER;                \
        ((ruci_para_reg_read_t *)msg)->sub_header                     = RUCI_CODE_REG_READ;                     \
        ((ruci_para_reg_read_t *)msg)->length                         = RUCI_PARA_LEN_REG_READ;                 \
        ((ruci_para_reg_read_t *)msg)->addr                           = addr_in;                                \
        }while(0)

